import React from "react";
import { Parallax, Background } from "react-parallax";

import img from "../3_images/2_theInitiative/bg_initiative-banner-blur.jpg";
import img1 from "../3_images/2_theInitiative/bg_initiative-banner.jpg";

export default function TheOriginalSix() {
  return (
    <div>
      <Parallax
        blur={10}
        bgImage={require("path/to/image.jpg")}
        bgImageAlt="the cat"
        strength={200}
      >
        Put some text content here - even an empty div with fixed dimensions to
        have a height for the parallax.
        <div style={{ height: "200px" }} />
      </Parallax>
    </div>
  );
}
